import * as React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import { Stack } from '@mui/material';
import Card from '@mui/material/Card';
import { CardContent, CardMedia } from '@mui/material'
import Grid from '@mui/material/Unstable_Grid2';
import Icon from '../img/logo.svg'
import { experimentalStyled as styled } from '@mui/material/styles';
import TextField from '@mui/material/TextField';
import { useNavigate } from 'react-router-dom'


const Item = styled(Card)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: 'auto',
    maxWidth: 400,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));

const Info_Update: React.FC = () => {
    const navigate = useNavigate();

    const goInfo = () => {
      navigate('/info')
    };


    return (

        <div className='company_info'>
            <Box sx={{ display: 'flex',position:'relative', width:1500, height: 600, margin:'auto', border: 1, borderRadius: 5, backgroundColor:'#ffffff', flexDirection: 'column',mt:5, padding: 5 }} >
            <Box sx={{ flexGrow: 1, maxWidth: 1500, margin:0}}>
            <Grid container spacing={{ xs: 1, md: 3 }} columns={{ xs: 4, sm: 8, md: 8 }}>
            {Array.from(Array(1)).map((_, index) => (
                <Grid xs={2} sm={1} md={2} key={index}>
                <Item>
                    <CardContent>
                        <CardMedia
                            component="img"
                            sx={{ width: 300  }}
                            image={Icon}
                            alt="Paella dish"
                        />
                    </CardContent>
                    <CardContent>
                        <Typography gutterBottom variant="h5" component="div">
                        기업설명
                        </Typography>
                        <input type="file" id="fileUpload" />
                    </CardContent>
                </Item>
                </Grid>
            ))}
            <Stack marginLeft={20}>
             <Typography variant="h6"  sx={{ fontWeight:'bold', marginLeft:10,marginTop:1 }} >회사명 : </Typography>
             <TextField id="join-pw" label="회사명" variant="outlined" size="small"  margin="normal"  sx={{ width: 600 }}/>
             <Typography variant="h6"  sx={{ fontWeight:'bold', marginLeft:10,marginTop:1 }}>홈페이지주소 :</Typography>
             <TextField id="join-pw" label="회사명" variant="outlined" size="small"  margin="normal"  sx={{ width: 600 }}/>            
             <Typography variant="h6"  sx={{ fontWeight:'bold', marginLeft:10,marginTop:1 }}>기업정보 : </Typography>
             <TextField id="join-pw" label="회사명" variant="outlined" size="small"  margin="normal"  sx={{ width: 600 }}/>           
             <Typography variant="h6"  sx={{ fontWeight:'bold', marginLeft:10,marginTop:1 }}>기업요약 :</Typography>
             <TextField id="join-pw" label="회사명" variant="outlined" size="small"  margin="normal"  sx={{ width: 600 }}/>          
             <Typography variant="h6"  sx={{ fontWeight:'bold', marginLeft:10,marginTop:1 }}>대표 : </Typography>
             <TextField id="join-pw" label="회사명" variant="outlined" size="small"  margin="normal"  sx={{ width: 600 }}/>        
             <Typography variant="h6"  sx={{ fontWeight:'bold', marginLeft:10,marginTop:1 }}>주소 : </Typography>
             <TextField id="join-pw" label="회사명" variant="outlined" size="small"  margin="normal"  sx={{ width: 600 }}/>
            </Stack>
            </Grid>
        </Box>

            </Box>
            <Stack direction="row" spacing={2}  marginTop={2} alignItems="center" marginLeft={100}>
                    <Button variant="contained" sx={{ color:'#ffff', backgroundColor: '#5856D6', borderColor:'#434343'}} onClick={() => { goInfo() }}>
                        수정
                    </Button>
                    <Button variant="outlined" sx={{color:'#ffff', backgroundColor: '#5856D6', borderColor:'#434343'}} onClick={() => { goInfo() }}>
                        취소
                    </Button>
            </Stack>
        </div>
    );
}
export default Info_Update;
